import React from 'react';
import { ChakraProvider, Box} from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Box backgroundColor="pink"
      minH="100vh"
      padding="150px 400px 10px"
      >
        <Box 
        backgroundColor="white"
        minH="300px"
        padding="50px"
        >
          <h1>5</h1>
        </Box>
      </Box>
    </ChakraProvider>
  );
}

export default App;
